b61009e1-710f-41d6-aaed-bacc4eac79c0=README\r\n\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\r\n\r\nAll Insights Hub apps must have a Insights Hub OS Bar. This unifies the UI of all Insights Hub apps. It is used for showing the app name,\r\nrouting back to the Launchpad, and logging out from Insights Hub easily. Apps without the Insights Hub OS Bar will not be validated\r\nfor deployment to a Insights Hub production environment.\r\n\r\nThis Connector enables Insights Hub OS Bar customization for your Mendix app running in Insights Hub cloud.\r\n\r\nConfiguration\r\n----------------\r\nThe configuration is be done via a JSON object held in the string constant 'Config' in the '_Use me' folder.\r\n\r\nThe JSON should contain the following information\:\r\n\u2022  displayName \u2013 the display name of your app\r\n\u2022  appVersion \u2013 the version number of your app\r\n\u2022  appCopyright \u2013 app owner\u2019s name and year of publication\r\n\u2022  links \u2013 links to additional information about the app\r\n
